import React, {useState, useRef} from 'react';
import {View, StyleSheet } from 'react-native';
import { captureRef } from "react-native-view-shot";

const SvgImageRef = useRef(null)

export default function avatarRender({ avatarFeatures}) {
    const [imageBase64, setImageBase64] = useState(
        {
            re_render : true,
            image: 'data:image/png;base64,'
        }
    )   
    // const []

    loadSVGImage(setImageBase64).then(image => {
        console.log(image)
    })
    return (
    <View>
        <Image 
            resizeMode='cover'
            source={{uri: imageBase64.image}}
        />
    </View>
  )
}

let loadSVGImage = async(setImageBase64) => {
    return <SVGImage 
      ref={SvgImageRef}
      onLayout={()=>{
        captureRef(SvgImageRef, {
            format: "jpg",
            quality: 0.8
          }).then(
            uri => {setImageBase64(uri); console.log("Image saved to", uri)},
            error => console.error("Oops, snapshot failed", error)
          );
        // setImageBase64('')
    }} />
}

